import React from 'react';


const Dummy= () =>{
    const h1 = document.getElementById('dummy');
    return(
        <div>
            <h1 style={{height:'20px', width:'20px'}} 
                id='dummy'>Hello Dummy Component
            </h1>
            {h1.innerHTML}
        </div>
    );
}

export default Dummy;
